import './App.css';

function App() {
  return (
    <div className="App">
      <div className="nav">
        <NavLink exact to="/" activeClassName="active">Home</NavLink>
        <NavLink exact to="/about" activeClassName="active">About</NavLink>
      </div>
    </div>
  );
}

export default App;
